var previewButtonsAdded = false;
function openConversation(id) {
    //window.location.href = `https://www.userlike.com/de/umc/#/conversation/${id}`;
    window.location.assign(`https://www.userlike.com/de/umc/#/conversation/${id}`);
    var iframeContainer = document.getElementById("iframe-container");
    iframeContainer.style.right = "-50%";
}
function toggleIframe(id) {
    console.log("toggle");
    var iframeContainer = document.getElementById("iframe-container");
    var iframe = document.getElementById("my-iframe");

    if (iframeContainer.style.right === "0px" && currentConversation == id) {
        // If the iframe is already visible, slide it out
        iframeContainer.style.right = "-50%";
    } else {
        // If the iframe is hidden, set the src and slide it in
        iframe.src = `https://www.userlike.com/de/umc/#/conversation/${id}?#reader`;
        iframeContainer.style.right = "0";
        // Create a <style> element and set the CSS rules you want

    }
    currentConversation = id;
}
window.addEventListener("click", function (event) {
    var iframeContainer = document.getElementById("iframe-container");
    if (event.target !== iframeContainer && !iframeContainer.contains(event.target)) {
        console.debug(event);
        iframeContainer.style.right = "-50%";
    }
});


